            #region public (static) methods

            /// <summary>Gets the weights and abscissas of a specific Gauss-Tschebyscheff Quadrature.
            /// </summary>
            /// <param name="order">The order of the Gauss-Tschebyscheff Quadrature.</param>
            /// <param name="weight">The (constant) weight of the Gauss-Tschebyscheff Quadrature (output).</param>
            /// <returns>The abscissas, i.e. evaluation points of the Gauss-Tschebyscheff Quadrature</returns>
            public static double[] GetValue(int order, out double weight)
            {
                if (order < 1)
                {
                    throw new ArgumentException(String.Format(ExceptionMessages.ArgumentOutOfRangeGreaterEqual, "order", 2), nameof(order));
                }
                if (order > sm_Weights.Length)  // we cache the first 300 weights and abscissas only
                {
                    return ComputeCoefficients(order, out weight);
                }
                weight = sm_Weights[order - 1];
                return sm_Abscissas[order - 1];
            }

#if DEBUG
            /// <summary>Writes weights and abscissas of the Gauss-Tschebyscheff Quadrature up to a specific order into a specific file.
            /// </summary>
            /// <param name="maxOrder">The maximal order.</param>
            /// <param name="filePath">The file path.</param>
            public static void Write(int maxOrder, string filePath)
            {
                var stream = File.CreateText(filePath);
                stream.WriteLine("private static double[] sm_Weights = {");

                for (int order = 1; order < maxOrder - 1; order++)
                {
                    double weight = Math.PI / order;
                    stream.WriteLine("\t {0},", weight.ToString("G17", CultureInfo.InvariantCulture));
                }
                double lastWeight = Math.PI / maxOrder;
                stream.Write("\t {0}", lastWeight.ToString("G17", CultureInfo.InvariantCulture));
                stream.WriteLine("};");
                stream.WriteLine();

                stream.WriteLine("private static double[][] sm_Abscissas = {");

                for (int order = 1; order < maxOrder; order++)
                {
                    var weight = Math.Cos(Math.PI * 0.5 / order); // first weight
                    stream.Write("\t new[] {");
                    stream.Write(" {0},", weight.ToString("G17", CultureInfo.InvariantCulture));
                    stream.WriteLine();

                    for (int i = 2; i <= order; i++)
                    {
                        weight = Math.Cos(Math.PI * (i - 0.5) / order);

                        stream.Write("\t         {0},", weight.ToString("G17", CultureInfo.InvariantCulture));
                        stream.WriteLine();
                    }

                    stream.WriteLine("\t       },");
                }
                stream.WriteLine("\t\t};");

                stream.Close();
            }
#endif
            #endregion

            #region internal (static) methods

            /// <summary>Computes the weights and abscissas of a specific Gauss-Tschebyscheff Quadrature.
            /// </summary>
            /// <param name="order">The order of the Gauss-Tschebyscheff Quadrature.</param>
            /// <param name="weight">The (constant) weight of the Gauss-Tschebyscheff Quadrature (output).</param>
            /// <returns>The abscissas, i.e. evaluation points of the Gauss-Tschebyscheff Quadrature</returns>
            internal static double[] ComputeCoefficients(int order, out double weight)
            {
                weight = Math.PI / order;

                var xArray = new double[order];
                for (int i = 1; i <= order; i++)
                {
                    xArray[i - 1] = Math.Cos(Math.PI * (i - 0.5) / order);
                }
                return xArray;
            }
            #endregion
